    constructor(props) {
        super(props);

        this.voxelmodel_TL = new TimelineMax({paused: true});
    }

    componentDidMount() {
        TweenMax.set($(".monkey-3"), {scale: 0, transformOrigin: "50% 50%"});
        this.voxelmodel_TL
        .to($(".monkey-3"), {scale: 1, 
                            duration: 0.15,
                            transformOrigin: "50% 50%", 
                            stagger: {
                                grid: [7,15],
                                from: "end",
                                each: 0.08,
                            }}, 0.1)
        .to("#Original", 0.3, {autoAlpha: 0});
    }

